import React from "react";
import {Chart} from 'primereact/chart';

export default function Pie2() {

  const data = {
    labels: ['Neutral','Total'],
    datasets: [
        {
            data: [320,960],
            backgroundColor: [
                "#d8c221"
            ],
            hoverBackgroundColor: [
                "#d8c221"
            ]
        }]
    };
    return (
      <div>
      <Chart width="50" height="50" type="pie" data={data} />
  </div>
    );
  }
